import React from "react";
import {
  Button,
  Form,
  FormControl,
  Nav,
  Navbar,
  NavDropdown,
} from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
const Header = () => {
  return <Navbar expand="lg" sticky="top" className="header"></Navbar>;
};

export default Header;
